			shellScript = "#  Build the doxygen documentation for the project and load the docset into Xcode.\n#  If the DOXYGEN_PATH is not correct for you please check the \"Get Info\" for this\n#  target, the majority of variables for this script have been defined there.\n#\n#  Use the following to adjust the value of the $DOXYGEN_PATH User-Defined Setting:\n#    Binary install location: /Applications/Doxygen.app/Contents/Resources/doxygen\n#    Source build install location: /usr/local/bin/doxygen\n\n#  If the config file doesn't exist, run 'doxygen -g $SOURCE_ROOT/doxygen.config' to \n#  a get default file.\n\nif [ -z $DOXYGEN_PATH ]\nthen\n  echo You must set the DOXYGEN_PATH variable in the Docs target\n  exit 1\nfi\n\nif [ -z $OUTPUT_DIRECTORY ]\nthen\n  echo You must set the OUTPUT_DIRECTORY variable in the Docs target\n  exit 1\nfi\n\nif [ -z $DOXYGEN_CONFIG ]\nthen\n  echo You must set the DOXYGEN_CONFIG variable in the Docs targe\n  exit 1\nfi\n\nif [ -z $DOCSET_BUNDLE_ID ]\nthen\n  echo You must set the DOCSET_BUNDLE_ID variable in the Docs target\n  exit 1\nfi\n\nif [ -z $INTERNAL_DOCS ]\nthen\nINTERNAL_DOCS=\"NO\"\nfi\n\nif ! [ -f $SOURCE_ROOT/$DOXYGEN_CONFIG ] \nthen \n  echo doxygen config file does not exist\n  $DOXYGEN_PATH -g $SOURCE_ROOT/$DOXYGEN_CONFIG\nfi\n\n#  Append the proper input/output directories and docset info to the config file.\n#  This works even though values are assigned higher up in the file. Easier than sed.\n\ncp $SOURCE_ROOT/$DOXYGEN_CONFIG $TEMP_DIR/doxygen.config\n\nif ! [ -d $SOURCE_ROOT/$OUTPUT_DIRECTORY ]\nthen\n  mkdir -p $SOURCE_ROOT/$OUTPUT_DIRECTORY\nfi\n\necho \"OUTPUT_DIRECTORY = $SOURCE_ROOT/$OUTPUT_DIRECTORY\" >> $TEMP_DIR/doxygen.config\necho \"DOCSET_BUNDLE_ID = $DOCSET_BUNDLE_ID\" >> $TEMP_DIR/doxygen.config\necho \"INTERNAL_DOCS = $INTERNAL_DOCS\" >> $TEMP_DIR/doxygen.config\n\nappledoc -p \"$PROJECT_NAME.framework\" -i \"$SRCROOT/Source\" -o \"$OUTPUT_DIRECTORY\" \\\n\t--doxyfile \"$TEMP_DIR/doxygen.config\" --doxygen \"$DOXYGEN_PATH\" \\\n\t--xhtml --docset --docplist \"$SRCROOT/$DOCSET_INFO_PLIST\" \\\n\t--xhtml-bordered-issues --fix-class-locations --clean-before-build\n\n#  Construct a temporary applescript file to tell Xcode to load a docset.\n\nrm -f $TEMP_DIR/loadDocSet.scpt\n\necho \"tell application \\\"Xcode\\\"\" >> $TEMP_DIR/loadDocSet.scpt\necho \"load documentation set with path \\\"/Users/$USER/Library/Developer/Shared/Documentation/DocSets/\\\"\" \n     >> $TEMP_DIR/loadDocSet.scpt\necho \"end tell\" >> $TEMP_DIR/loadDocSet.scpt\n\n#  Run the load-docset applescript command.\n\nif [ -n $DOXYGEN_LOAD_DOCSET -a $DOXYGEN_LOAD_DOCSET = \"YES\" ]; then\n\tosascript $TEMP_DIR/loadDocSet.scpt\nfi\n\nexit 0\n";
